import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { saveShippingAddress } from "./../../actions/cartActions";
import { Form, Button } from "react-bootstrap";

import FormContainer from "./FormContainer/FormContainer.js";

const ShippingScreen = ({ history }) => {
	const cart = useSelector((state) => state.cart);
	const { shippingAddress } = cart;
	console.log(shippingAddress);
	const dispatch = useDispatch();

	const [address, setAddress] = useState(shippingAddress.address);
	const [country, setCountry] = useState(shippingAddress.country);
	const [state, setState] = useState(shippingAddress.state);
	const [postalCode, setPostalCode] = useState(shippingAddress.postalCode);
	const [city, setCity] = useState(shippingAddress.city);
	const [lga, setLga] = useState(shippingAddress.lga);
	const [homeLandmark, setHomeLandmark] = useState(
		shippingAddress.homeLandmark
	);

	const submitHandler = (e) => {
		e.preventDefault();
		dispatch(
			saveShippingAddress({
				address,
				country,
				homeLandmark,
				lga,
				postalCode,
				city,
				state,
			})
		);
		history.push("/payment");
	};

	return (
		<FormContainer>
			<h1>Shipping</h1>
			<Form onSubmit={submitHandler}>
				<Form.Group controlId="address">
					<Form.Label>Address</Form.Label>
					<Form.Control
						type="address"
						placeholder="Enter Address"
						value={address}
						onChange={(e) => setAddress(e.target.value)}
					></Form.Control>
				</Form.Group>
				<Form.Group controlId="country">
					<Form.Label>Country</Form.Label>
					<Form.Control
						type="country"
						placeholder="Enter country"
						value={country}
						onChange={(e) => setCountry(e.target.value)}
					></Form.Control>
				</Form.Group>
				<Form.Group controlId="state">
					<Form.Label>State of Residence</Form.Label>
					<Form.Control
						type="state"
						placeholder="The state you presently reside"
						value={state}
						onChange={(e) => setState(e.target.value)}
					></Form.Control>
				</Form.Group>
				<Form.Group controlId="postalCode">
					<Form.Label>postalCode</Form.Label>
					<Form.Control
						type="text"
						placeholder="Enter postalCode"
						value={postalCode}
						onChange={(e) => setPostalCode(e.target.value)}
					></Form.Control>
				</Form.Group>
				<Form.Group controlId="lga">
					<Form.Label>lga</Form.Label>
					<Form.Control
						type="text"
						placeholder="Enter lga"
						value={lga}
						onChange={(e) => setLga(e.target.value)}
					></Form.Control>
				</Form.Group>
				<Form.Group controlId="homeLandmark">
					<Form.Label>Home Landmark</Form.Label>
					<Form.Control
						type="text"
						placeholder="Enter home Landmark"
						value={homeLandmark}
						onChange={(e) => setHomeLandmark(e.target.value)}
					></Form.Control>
				</Form.Group>
				<Form.Group controlId="city">
					<Form.Label>City</Form.Label>
					<Form.Control
						type="text"
						placeholder="Enter City i.e Abuja, Onitsha"
						value={city}
						onChange={(e) => setCity(e.target.value)}
					></Form.Control>
				</Form.Group>
			</Form>
			<Button type="submit" variant="primary">
				Continue
			</Button>
		</FormContainer>
	);
};

export default ShippingScreen;
